var initialLabourDate = '';
var initialAdvanceAmount = '';

function addRow() {
    var date = document.getElementById('date').value;
    var masonCount = document.getElementById('masoncount').value;
    var masonAmount = document.getElementById('masonamount').value;
    var helperCount = document.getElementById('helpercount').value;
    var helperAmount = document.getElementById('helperamount').value;
    var companyName = document.getElementById('companyname').value;

    localStorage.setItem('labourDate', date);
    localStorage.setItem('companyName', companyName);

    // Store initial values if not already stored
    if (initialLabourDate === '') {
        initialLabourDate = date;
    }

    // Store advance amount in localStorage
    if (initialAdvanceAmount === '') {
        initialAdvanceAmount = document.getElementById('advance').value;
        localStorage.setItem('advanceAmount', initialAdvanceAmount); // Store in localStorage
    }

    var tableRef = document.getElementById('dataTable').getElementsByTagName('tbody')[0];
    var newRow = tableRef.insertRow();

    var cellDate = newRow.insertCell(0);
    var cellMasonCount = newRow.insertCell(1);
    var cellMasonAmount = newRow.insertCell(2);
    var cellHelperCount = newRow.insertCell(3);
    var cellHelperAmount = newRow.insertCell(4);
    var cellAmount = newRow.insertCell(5);
    var cellActions = newRow.insertCell(6);

    cellDate.textContent = initialLabourDate;
    document.getElementById('date').value = initialLabourDate;

    cellMasonCount.textContent = masonCount;
    cellMasonAmount.textContent = masonAmount;
    cellHelperCount.textContent = helperCount;
    cellHelperAmount.textContent = helperAmount;
    cellAmount.textContent = (parseInt(masonAmount) + parseInt(helperAmount));

    var deleteButton = document.createElement('button');
    deleteButton.textContent = 'Delete';
    deleteButton.onclick = function () {
        tableRef.deleteRow(newRow.rowIndex - 1);
        calculateTotals();
        updateLocalStorage();
    };
    cellActions.appendChild(deleteButton);

    document.getElementById('masoncount').value = '';
    document.getElementById('masonamount').value = '';
    document.getElementById('helpercount').value = '';
    document.getElementById('helperamount').value = '';

    calculateTotals();
    updateLocalStorage();
}

// Function to calculate totals and update UI
function calculateTotals() {
    var table = document.getElementById('dataTable').getElementsByTagName('tbody')[0];
    var advanceTotal = parseInt(document.getElementById('advance').value) || 0;
    var helperTotal = 0;
    var masonTotal = 0;
    var totalAmount = 0;

    for (var i = 0; i < table.rows.length; i++) {
        var row = table.rows[i];
        var masonAmount = parseInt(row.cells[2].innerHTML);
        var helperAmount = parseInt(row.cells[4].innerHTML);
        var rowAmount = (parseInt(masonAmount) + parseInt(helperAmount));

        masonTotal += masonAmount;
        helperTotal += helperAmount;
        totalAmount += rowAmount; // Accumulate row amounts for total amount
    }

    // Update helper total amount input field
    document.getElementById('helpertotalamount').value = helperTotal;

    // Update mason total amount input field
    document.getElementById('masontotalamount').value = masonTotal;

    // Update total amount input field
    document.getElementById('totalamount').value = totalAmount;

    // Update advance amount input field
    document.getElementById('advanceamount').value = advanceTotal;

    // Update grand total input field
    var grandTotal = totalAmount - advanceTotal;
    document.getElementById('grandamount').value = grandTotal;

    // Update localStorage after calculating totals
    updateLocalStorage();
}

// Function to update localStorage with current table data
function updateLocalStorage() {
    var tableData = [];
    var table = document.getElementById('dataTable').getElementsByTagName('tbody')[0];

    for (var i = 0; i < table.rows.length; i++) {
        var row = table.rows[i];
        var rowData = {
            date: row.cells[0].textContent,
            masonCount: row.cells[1].textContent,
            masonAmount: row.cells[2].textContent,
            helperCount: row.cells[3].textContent,
            helperAmount: row.cells[4].textContent,
            amount: row.cells[5].textContent
        };
        tableData.push(rowData);
    }

    // Store data in localStorage
    localStorage.setItem('invoiceData', JSON.stringify(tableData));

    // Store the advance amount in localStorage
    var advanceAmount = document.getElementById('advance').value;
    localStorage.setItem('advanceAmount', advanceAmount);

}


function initializeTableFromLocalStorage() {
    var storedData = localStorage.getItem('invoiceData');
    var storedAdvanceAmount = localStorage.getItem('advanceAmount'); // Retrieve advance amount

    var storedLabourDate = localStorage.getItem('labourDate');
    var storedCompanyName = localStorage.getItem('companyName');

    if (storedLabourDate) {
        document.getElementById('date').value = storedLabourDate;
        initialLabourDate = storedLabourDate;
    }

    if (storedCompanyName) {
        document.getElementById('companyname').value = storedCompanyName;
    }

    if (storedAdvanceAmount) {
        document.getElementById('advance').value = storedAdvanceAmount; // Set advance amount in the input field
    }

    if (storedData) {
        var tableData = JSON.parse(storedData);
        var tableRef = document.getElementById('dataTable').getElementsByTagName('tbody')[0];

        tableData.forEach(function (rowData) {
            var newRow = tableRef.insertRow();
            var cellDate = newRow.insertCell(0);
            var cellMasonCount = newRow.insertCell(1);
            var cellMasonAmount = newRow.insertCell(2);
            var cellHelperCount = newRow.insertCell(3);
            var cellHelperAmount = newRow.insertCell(4);
            var cellAmount = newRow.insertCell(5);
            var cellActions = newRow.insertCell(6);

            cellDate.textContent = rowData.date;
            cellMasonCount.textContent = rowData.masonCount;
            cellMasonAmount.textContent = rowData.masonAmount;
            cellHelperCount.textContent = rowData.helperCount;
            cellHelperAmount.textContent = rowData.helperAmount;
            cellAmount.textContent = rowData.amount;

            var deleteButton = document.createElement('button');
            deleteButton.textContent = 'Delete';
            deleteButton.onclick = function () {
                tableRef.deleteRow(newRow.rowIndex - 1);
                calculateTotals();
                updateLocalStorage();
            };
            cellActions.appendChild(deleteButton);
        });

        calculateTotals();
    }
}

// Call initialize function on page load
document.addEventListener('DOMContentLoaded', function () {
    initializeTableFromLocalStorage();

    // Retrieve advance amount from localStorage
    var storedAdvanceAmount = localStorage.getItem('advanceAmount');
    if (storedAdvanceAmount) {
        document.getElementById('advance').value = storedAdvanceAmount;
    }

    calculateTotals(); // Recalculate totals to ensure everything is up-to-date
});


function cleardata() {
    // Clear localStorage data
    localStorage.removeItem('invoiceData'); // Clear the stored table data
    localStorage.removeItem('advanceAmount'); // Clear the stored advance amount
    localStorage.removeItem('labourDate'); // Clear the stored labour date
    localStorage.removeItem('companyName'); // Clear the stored company name

    // Clear table contents
    document.getElementById('dataTable').getElementsByTagName('tbody')[0].innerHTML = '';

    // Clear advance amount input field and reset initial value
    document.getElementById('advance').value = '';
    initialAdvanceAmount = ''; // Reset the initial advance amount

    // Clear labour date input field and reset initial value
    document.getElementById('date').value = '';
    initialLabourDate = ''; // Reset the initial labour date

    // Clear company name input field
    document.getElementById('companyname').value = '';

    // Recalculate totals after clearing data
    calculateTotals();
}


function generatePDF() {
    // Retrieve the company name from the input field
    var companyName = document.getElementById("companyname").value;

    var today = new Date();
    var dd = String(today.getDate()).padStart(2, '0');
    var mm = String(today.getMonth() + 1).padStart(2, '0'); // January is 0!
    var yyyy = today.getFullYear();
    today = mm + '/' + dd + '/' + yyyy;

    var date = document.getElementById("date").value;
    var advance = document.getElementById("advance").value;
    var masonTotal = document.getElementById("masontotalamount").value;
    var helperTotal = document.getElementById("helpertotalamount").value;
    var totalAmount = document.getElementById("totalamount").value;
    var grandTotal = document.getElementById("grandamount").value;

    var table = document.getElementById("dataTable");
    var rows = table.getElementsByTagName("tbody")[0].rows;

    // Mapping rows to HTML content
    var rowContent = Array.from(rows).map((row, index) => {
        var cells = row.cells;
        var labourDate = cells[0].textContent;   // Labour Date
        var masonAmount = cells[2].textContent;  // Mason Amount
        var helperAmount = cells[4].textContent; // Helper Amount
        var amount = cells[5].textContent;       // Amount

        return `
            <tr style="border: 1px solid black;">
            <td style="border: 1px solid black;">${index + 1}</td>
            <td style="border: 1px solid black;">${labourDate}</td>
            <td style="border: 1px solid black;">${masonAmount}</td>
            <td style="border: 1px solid black;">${helperAmount}</td>
            <td style="border: 1px solid black;">${amount}</td>
        </tr>`;
    }).join(""); // Join all rows into a single string


    var image = 'data:image/jpeg;base64,'

    // HTML content for the PDF with dynamic company name
    var pdfContent = `
    <body class="p-10 bg-white">
        <div class="flex justify-between mb-6">
            <div class="w-24 h-24 flex items-center justify-center">
                <img src="${image}" alt="Company Logo">
            </div>
            <div class="text-right">
                <h1 class="text-lg">
                 <span class="text-blue-500 font-bold text-3xl" style="font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif";>Dream 4 You</span>
                </h1>
                <p>Phone: +91 7401102535</p>
                <p>Email: praveenk73200@gmail.com</p>
            </div>
        </div>

        <table class="min-w-full border-collapse border border-black mb-6">
            <thead style="color: black;">
                <tr style="background-color: white;">
                    <th class="border border-black p-2 text-center" style="color: black;">S.no</th>
                    <th class="border border-black p-2 text-center" style="color: black;">Labour Date</th>
                    <th class="border border-black p-2 text-center" style="color: black;">Mason</th>
                    <th class="border border-black p-2 text-center" style="color: black;">Helper</th>
                    <th class="border border-black p-2 text-center" style="color: black;">Amount</th>
                </tr>
            </thead>
            <tbody>
                ${rowContent} <!-- Inject the mapped rows here -->
            </tbody>
        </table>

        <div class="w-full flex justify-end">
            <table class="w-auto border-collapse border border-black mb-6">
                <tbody>
                    <tr>
                        <td class="border border-black p-2 w-32 text-center">${masonTotal}</td>
                        <td class="border border-black p-2 w-32 text-center">${helperTotal}</td>
                        <td class="border border-black p-2 w-36 text-center">${totalAmount}</td>
                    </tr>
                    <tr>
                        <td colspan="2" class="border border-black p-2 text-center">Advance:</td>
                        <td colspan="4" class="border border-black p-2 text-center">${advance}</td>
                    </tr>
                    <tr>
                        <td colspan="2" class="border border-black p-2 text-center">GrandTotal:</td>
                        <td colspan="4" class="border border-black p-2 text-center">${grandTotal}</td>
                    </tr>
                </tbody>
            </table>
        </div>

        <div class="flex justify-between">
            <div>
                <p>Date: ${today}</p>
                <p>Company Name: <span class="font-bold" style="font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;">${companyName}</span></p>
            </div>
        </div>
    </body>`;

    var options = {
        margin: 10,
        filename: "dream4you.pdf",
        image: { type: "jpeg", quality: 1 },
        html2canvas: { scale: 8, logging: true, dpi: 800 },
        jsPDF: { unit: "mm", format: "a4", orientation: "portrait" },
    };

    // Generate PDF from HTML content
    html2pdf().from(pdfContent).set(options).save();
}
